import React from 'react';
import './css/App.css';
import HomePage from './components/homepage';
import SignInPage from './components/signinpage';
import SignUpPage from './components/signuppage';
import UploadFilePage from './components/uploadfilepage';
import SignalVisualizationPage from './components/signalvisualizationpage';
import ProfilePage from './components/profilepage';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path='/' exact component={HomePage}/>
          <Route path='/join/signup' component={SignUpPage}/>
          <Route path='/join/signin' component={SignInPage}/>
          <Route path='/upload' component={UploadFilePage}/>
          <Route path='/data' component={SignalVisualizationPage}/>
          <Route path='/profile' component={ProfilePage}/>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
